    implicit def Prod4Lens0[F[_], A1, A2, A3, A4]: Lens[Prod4[F, A1, A2, A3, A4], F[A1]] =
      Lens(p => StoreT.store[F[A1], Prod4[F, A1, A2, A3, A4]](p.t1)(x =>
